import React from 'react';

function LoginForm() {
  return (
    <div>
      <h2>Giriş Yap</h2>
      <form>
        <input type="text" placeholder="Kullanıcı Adı" /><br />
        <input type="password" placeholder="Şifre" /><br />
        <button type="submit">Giriş</button>
      </form>
    </div>
  );
}

export default LoginForm;
